#include <iostream>
#include <algorithm>
using namespace std;
int res[1000][100];
int ish[130];
int main()
{
    cout << "Размер вектора(альфа = ..x^0 + ..x^1 + ...):\n";
    int n;
    cin >> n;
    cout << "вектор альфа = ..x^0 + ..x^1 + ... :\n";
    for(int i = 0; i < n; i++)
        cin >> ish[i];
    
    cout << "харка x поля Z_x(модуль):\n";
    int mod;
    cin >> mod;
    for(int i = 0; i < n; i++) {
        res[i][i] = 1;
    }
    for(int i = 0; i < 130; i++)
        res[n][i] = ish[i];
        
    
    for(int i = n+1; i < 130; i++) {
        for(int j = 1; j < 130; j++) {
            res[i][j] = res[i-1][j-1];
        }
        int mult = res[i][n];
        res[i][n] = 0;
        for(int j = 0; j < n; j++) {
            res[i][j] = (res[i][j] + mult*res[n][j])%mod;
        }
    }
    
    for(int i = 0; i < 130; i++) {
        cout << "#" << i << ": ";
        for(int j = 0; j < n+2; j++) {
            cout << res[i][j] << ' ';
        }
        cout << '\n';
    }
    
    
    return 0;
}

#include <FastLED.h>

#define LED_PIN     2
#define NUM_LEDS 4
#define BRIGHTNESS  64
#define LED_TYPE    WS2811
#define COLOR_ORDER GRB
CRGB leds[NUM_LEDS];

const int buzzer = 11;

const int btn1 = 3;
const int btn2 = 4;
const int btn3 = 5;
const int btn4 = 6;

const int buzzTime = 300;

const CRGB Colors[] = {
  CRGB::Yellow,
  CRGB::Red,
  CRGB::Green,
  CRGB::Blue
};

int sequenceCounter = 1;

bool hasStartedGame = false;

void setup() {
  Serial.begin(9600);
  randomSeed(analogRead(0));

  FastLED.addLeds<LED_TYPE, LED_PIN, COLOR_ORDER>(leds, NUM_LEDS).setCorrection(TypicalLEDStrip);
  FastLED.setBrightness(BRIGHTNESS);
  
  pinMode(btn1, INPUT);
  pinMode(btn2, INPUT);
  pinMode(btn3, INPUT);
  pinMode(btn4, INPUT);

  pinMode(buzzer, OUTPUT);
}

void loop() {
  if (!hasStartedGame) {
    tone(buzzer, 600);
    delay(200);
    tone(buzzer, 200);
    delay(200);
    tone(buzzer, 600);
    delay(100);
    tone(buzzer, 700);
    delay(100);
    tone(buzzer, 800);
    delay(100);
    noTone(buzzer);
    
    print("Press any button to start!");
    while (!inputOn(btn1) && !inputOn(btn2) && !inputOn(btn3) && !inputOn(btn4))
      delay(10);
    print("Started game");
    hasStartedGame = true;
  }

  print("Sequence " + String(sequenceCounter));

  delay(1000);
  
  CRGB* sequence = generateSequence(sequenceCounter);

  for (int h = 0; h < sequenceCounter; h++)
    flashLEDStrip(sequence[h]);

  int checkIndex = 0;

  bool failed = false;

  while (true) {
    if (sequenceCounter == checkIndex) {
      delay(200);
      tone(buzzer, 600);
      delay(100);
      tone(buzzer, 700);
      delay(100);
      tone(buzzer, 800);
      delay(100);
      noTone(buzzer);
      break;
    }
    
    bool one = inputOn(btn1);
    bool two = inputOn(btn2);
    bool three = inputOn(btn3);
    bool four = inputOn(btn4);

    if (one || two || three || four) {
      int freq;
      if (one)
        freq = 200;
      if (two)
        freq = 400;
      if (three)
        freq = 600;
      if (four)
        freq = 800;
        
      if ((one && sequence[checkIndex] != Colors[0]) ||
          (two && sequence[checkIndex] != Colors[1]) ||
          (three && sequence[checkIndex] != Colors[2]) ||
          (four && sequence[checkIndex] != Colors[3])
      ) {
        failed = true;
        break;
      }
      checkIndex++;
      tone(buzzer, freq);
      delay(buzzTime);
      noTone(buzzer);
    }
  }
  
  free(sequence);

  if (failed) {
    print("You have failed the sequence");
    tone(buzzer, 800);
    delay(500);
    tone(buzzer, 200);
    delay(500);
    noTone(buzzer);
    delay(2000);
    exit(1);
  }

  print("Next sequence");
  sequenceCounter++;
  delay(1000);
}

void flashLEDStrip(CRGB color) {
  int toneFreq;
  
  if (color == CRGB::Yellow)
    toneFreq = 200;
  if (color == CRGB::Red)
    toneFreq = 400;
  if (color == CRGB::Green)
    toneFreq = 600;
  if (color == CRGB::Blue)
    toneFreq = 800;
  
  for(int i = 0; i < NUM_LEDS; i++)
    leds[i] = color;
    
  tone(buzzer, toneFreq);
  FastLED.show();
  
  delay(buzzTime);

  for(int i = 0; i < NUM_LEDS; i++)
    leds[i] = CRGB::Black;
  
  noTone(buzzer);
  FastLED.show();
  delay(500);
}

CRGB* generateSequence(int seqLength) {
    CRGB* arr = (CRGB*)malloc(seqLength * sizeof(CRGB));

    for (int i = 0; i < seqLength; i++)
      arr[i] = Colors[random(0, 4)];

    return arr;
}

bool inputOn(int pin) {
  return digitalRead(pin) == HIGH;
}

void print(String text) {
  Serial.println(text);
}

import { useEffect, useState } from 'react';

const isClient = typeof window === 'object';

type Dispatch<A> = (value: A) => void;
type SetStateAction<S> = S | ((prevState: S) => S);

export const useLocalStorage = <T>(
  key: string,
  initialValue?: T,
  raw?: boolean
): [T, Dispatch<SetStateAction<T>>] => {
  if (!isClient) {
    return [initialValue as T, () => {}];
  }

  const [state, setState] = useState<T>(() => {
    try {
      const localStorageValue = localStorage.getItem(key);
      if (typeof localStorageValue !== 'string') {
        localStorage.setItem(key, raw ? String(initialValue) : JSON.stringify(initialValue));
        return initialValue;
      } else {
        return raw ? localStorageValue : JSON.parse(localStorageValue || 'null');
      }
    } catch {
      // If user is in private mode or has storage restriction
      // localStorage can throw. JSON.parse and JSON.stringify
      // can throw, too.
      return initialValue;
    }
  });

  useEffect(() => {
    try {
      const serializedState = raw ? String(state) : JSON.stringify(state);
      localStorage.setItem(key, serializedState);
    } catch {
      // If user is in private mode or has storage restriction
      // localStorage can throw. Also JSON.stringify can throw.
    }
  }, [state]);

  return [state, setState];
};

#include <bits/stdc++.h>

using namespace std;
const int maxn = 100;
int n, m;
int graph[maxn][maxn];
bool bfs(vector<vector<int>> & r_graph, int S, int E, vector<int> & parent) {
    vector<bool> visited(n + 1, false);
    visited[S] = true;
    queue<int> q;
    q.push(S);
    parent[S] = -1;

    while(!q.empty()) {
        int node = q.front();
        q.pop();

        for(int i = 0; i < n; i++) {
            if(!visited[i] and r_graph[node][i] > 0) {
                if(i == E) {
                    parent[i] = node;
                    return true;
                }
                q.push(i);
                visited[i] = true;
                parent[i] = node;
            }
        }
    }
    return false;
}
int max_flow(int S, int E) {
    vector<vector<int>> r_graph(n, vector<int>(n, 0));
    for(int i = 0; i < n; i++) {
        for(int j = 0; j < n; j++) {
            r_graph[i][j] = graph[i][j];
        }
    }
    vector<int> parent(n);
    int res = 0;
    while(bfs(r_graph, S, E, parent)) {
        int path_flow = 2e9;
        for(int i = E; i != S; i = parent[i]) {
            path_flow = min(path_flow, r_graph[parent[i]][i]);
        }
        for(int i = E; i != S; i = parent[i]) {
            r_graph[parent[i]][i] -= path_flow;
            r_graph[i][parent[i]] += path_flow;
        }
        res += path_flow;
    }
    return res;
}
int main() {
    int m;
    cin >> m;
    n = 26;
    for(int i = 0; i < m; i++) {
        char a, b;
        cin >> a >> b;
        int c;
        cin >> c;

        graph[a - 'A'][b - 'A'] = c;
    }
    cout << "DA" << endl;
    cout << max_flow(('S' - 'A'), ('T' - 'A')) << endl;


    return 0;
}

