using System;

namespace CSLight
{
    internal class Program
    {
        static void Main(string[] args)
        {
            int[] numbers = { 1, 2, 3, 4, 5 };

            Console.WriteLine("Числа в массиве:");

            for (int i = 0; i < numbers.Length; i++)
            {
                Console.Write(numbers[i] + " ");
            }

            Console.WriteLine("\nНа сколько сдвинуть массив?");

            int shift = Convert.ToInt32(Console.ReadLine());

            while (shift > numbers.Length)
            {
                shift -= numbers.Length;
            }

            int[] shiftedBlock = new int[numbers.Length - shift];
            int[] wrapedBlock = new int[shift];

                for (int i = 0; i < numbers.Length; i++)
                {
                    if (i < numbers.Length - shift)
                    {
                        shiftedBlock[i] = numbers[i];
                    }
                    else
                    {
                        wrapedBlock[i - (numbers.Length - shift)] = numbers[i];
                    }
                }

            wrapedBlock.CopyTo(numbers, 0);
            shiftedBlock.CopyTo(numbers, shift);

            Console.WriteLine("Сдвинутый массив");
            for (int i = 0; i < numbers.Length; i++)
            {
                Console.Write(numbers[i] + " ");
            }

            Console.ReadKey();
        }
    }
}

